const SVG_WIDTH = 109;
const SVG_HEIGHT = 77;
const lineStrokWidth = 3;

const LetterA = ({top = 0, left = 0}) => {
  const [baseLine, setBaseLine] = useState(0);
  const [secondLine, setSecondLine] = useState(0);
  const [fourLine, setFourLine] = useState(0);
  const [totalLength, setTotalLength] = useState(0);
  const pathRef = useRef();
  const baseLineRef = useRef();
  const secondLineRef = useRef();
  const animation = useRef(new Animated.Value(0)).current;

  useEffect(() => {
    Animated.timing(animation, {
      toValue: 1,
      duration: 10000,
      useNativeDriver: true,
    }).start();
  }, []);

  console.log('animation', animation);

  const strokeDashoffset = animation.interpolate({
    inputRange: [0, 1],
    outputRange: [793, 0],
  });

  useEffect(() => {
    if (pathRef.current) {
      const dimensions = getPathDimensions();
      console.log('dimensions', dimensions);
      setBaseLine(dimensions.maxY);
      setSecondLine(27);
    }
  }, [pathRef.current]);

  useEffect(() => {
    if (baseLineRef.current && secondLineRef.current) {
      console.log('baselineBB', baseLineRef.current.getBBox());
      console.log('secondlineBB', secondLineRef.current.getBBox());
      const {y: baseLineY} = baseLineRef.current.getBBox();
      const {y: secondLineY} = secondLineRef.current.getBBox();

      setFourLine(baseLineY + secondLineY);
    }
  }, [baseLineRef.current, secondLineRef.current]);

  const getPathDimensions = () => {
    if (pathRef.current) {
      const pathLength = pathRef.current.getTotalLength();
      console.log('pathLength', pathLength);
      const pathCoordinates = Array.from({length: pathLength}, (_, i) =>
        pathRef.current.getPointAtLength(i),
      );
      const minX = Math.min(...pathCoordinates.map(point => point.x));
      const minY = Math.min(...pathCoordinates.map(point => point.y));
      const maxX = Math.max(...pathCoordinates.map(point => point.x));
      const maxY = Math.max(...pathCoordinates.map(point => point.y));
      const width = maxX - minX;
      const height = maxY - minY;
      return {width, height, maxY, minY};
    }
  };

  return (
    <Svg
      fill={'none'}
      width={SVG_WIDTH}
      height={SVG_HEIGHT}
      viewBox={`0 0 ${SVG_WIDTH} ${SVG_HEIGHT}`}>
      {/* first */}
      <Line
        stroke={'gray'}
        strokeWidth={lineStrokWidth}
        x1={0}
        x2={SVG_WIDTH}
        y1={2}
        y2={2}
        strokeLinecap="round"
      />

      {/* baseline */}
      <Line
        ref={baseLineRef}
        stroke={'gray'}
        strokeWidth={2}
        x1={0}
        x2={SVG_WIDTH}
        y1={baseLine}
        y2={baseLine}
        strokeLinecap="round"
      />
      {/* second */}
      <Line
        ref={secondLineRef}
        stroke={'gray'}
        strokeWidth={2}
        x1={0}
        x2={SVG_WIDTH}
        y1={secondLine}
        y2={secondLine}
        strokeLinecap="round"
      />

      {/* four */}
      <Line
        stroke={'gray'}
        strokeWidth={lineStrokWidth}
        x1={0}
        x2={SVG_WIDTH}
        y1={fourLine}
        y2={fourLine}
        strokeLinecap="round"
      />

      <Path ref={pathRef} d={letterPath} stroke={'gray'} opacity={0.5} />
      <AnimatedPath
        ref={pathRef}
        d={letterPath}
        stroke={'white'}
        strokeDasharray={793}
        strokeDashoffset={strokeDashoffset}
      />
    </Svg>
  );
};

